const e=JSON.parse('{"key":"v-3ed564ef","path":"/further/backend/login.html","title":"登录替换","lang":"en-US","frontmatter":{},"headers":[{"level":2,"title":"dependencies","slug":"dependencies","link":"#dependencies","children":[]},{"level":2,"title":"UserServiceInterface","slug":"userserviceinterface","link":"#userserviceinterface","children":[]},{"level":2,"title":"实现登录和退出","slug":"实现登录和退出","link":"#实现登录和退出","children":[]}],"git":{"createdTime":1701780913000,"updatedTime":1701780913000,"contributors":[{"name":"Moments","email":"554676262@qq.com","commits":1}]},"readingTime":{"minutes":1.67,"words":502},"filePathRelative":"further/backend/login.md","localizedDate":"December 5, 2023","excerpt":"<h1> 登录替换</h1>\\n<div class=\\"hint-container tip\\">\\n<p class=\\"hint-container-title\\">理念</p>\\n<p>MineAdmin 后台只提供了最基础的登录功能，即：只需要提供 <code>用户名</code> 和 <code>密码</code> 即可登录，大家看到的验证码只是前端进行验证。\\n并不存在任何后端逻辑，我们的理念就是提供最简单实用的功能，而把扩展的空间留给大家。</p>\\n<p>现在后台登录体验越来越友好，有的需要支持扫码登录、有的需要支持微信登录或者是短信验证码登录等方式，我们提供了<code>登录替换</code>功能，只需要对配置文件参数进行设置，然后开发自己的登录逻辑即可，不需要改动<code>MineAdmin</code>的任何原生功能。</p>\\n</div>"}');export{e as data};
